            <h1 className='font-bold bg-green-600 px-6 py-2 text-white text-lg rounded-lg shadow-lg shadow-slate-500'> {controls.title }</h1>
        </div>

        {/* Content  */}
        <div className='w-full border-[1px] p-3 rounded-md mt-12'>
            {controls.introduction}
        </div>


    </div>
  )
}

export default Controls
